import './style-button-theme.css';
import { themeOn, themeCookie } from './function-theme-control.js';
document.getElementById('hidcheck').addEventListener('change', themeOn);

//* Смена темы
function ButtonTheme() {
    return (
        <div id="q-container">
            <div className="main">
                <input type="checkbox" id="hidcheck" hidden />
                <label className="capsule" for="hidcheck" id="capsule-id">
                    <div className="circle"></div>
                    <div className="text-signs">
                        <span id="on"></span>
                    </div>
                </label>
            </div>
        </div>
    );
};

export default ButtonTheme;
